import React from "react";

function App() {
  let likes = 0;
  return (
    <div className="App">
      <button onClick={likes++}>Increment</button>
      <button onClick={likes--}>Decrement</button>
      <b>likes count: {likes}</b>
    </div>
  );
}

export default App;
